#협찬 지금, 물의 도시 베네치아에선 부첼라티의 대규모 회고전이 진행되고 있습니다. 이 중 크리에이티브 디렉터 안드레아 부첼라티가 그의 딸 루크레치아 부첼라티와 함께, 오로지 이번 전시만을 위해 제작한 ‘부첼라티 베니스 버터플라이’ 브로치에 특히 주목할 필요가 있는데요. 하우스의 가장 큰 영감이자 부활을 상징하는 나비 모티프에 다이아몬드를 섬세하게 세팅한 그 정교함이 눈길을 끕니다. 다이아몬드가 달성할 수 있는 가장 높은 등급 중 하나인 IF 투명도의 8.51캐럿과 VVS1 투명도의 5.10 캐럿이 나비의 몸통을, 50개의 1.92캐럿 나베트 컷 다이아몬드와 270개의 1.54캐럿 라운드 브릴리언트 컷 다이아몬드가 날개를 장식하고 있죠. 제작 영상만 봐도 홀린 듯 빨려 들어가게 되는 이 브로치와 더불어 각 세대의 모든 브로치를 만날 수 있는 해당 전시의 이름은 <금세공의 왕자, 클래식의 재발견(The Prince of Goldsmiths, Rediscovering the Classics)>. 여행을 계획하고 있다면 꼭 들러보세요. 베네치아 주데카 섬, 오피치네 800에서 6월 18일까지. @wkorea #editor_장진영
