Tomorrow is an important day for me! So, I’d like to start it with some pleasant news. Catch the right vibe with the new remix of track ‚SLAY‘ by the Polish DJ and producer Skytech and get charged up before our meeting 🪫
@skytechmusic : «Remixing ‚SLAY‘ was an exciting experience. Max’s vocals has a unique dance vibe, his sense of melody and songwriting talent are fresh. We’re excited to finally share the remix with the world.”
The new drop is already on all streaming platforms 🔥 I’d appreciate your comments!

Завтра для мене важливий день! Тому, я б хотів розпочати його з приємностей. Ловіть правильний вайб під новий remix треку SLAY від польського діджея і продюсера Skytech та заряджайтесь перед нашою зустріччю 🪫

@Skytech: ««Ремікс «SLAY» був захоплюючим досвідом. Вокал Макса має унікальну танцювальну атмосферу, його почуття мелодії та талант написання пісень свіжі. Ми раді нарешті поділитися реміксом зі світом».
Новий дроп вже на всіх стрімінгових платформах 🔥 Коментуємо!

Цей концерт був для мене дуже особливим. Як і кожен українець, я відчуваю велику напругу та роз’єднаність у нашому суспільстві, багато сварок, багато переживань... Саме тому, у цей вечір я зосередився на спілкуванні зі своїм слухачем, щоб надати надію та повернути віру. Тому що я вірю, що пісня може гуртувати людей навколо своєї країни. Як і завжди, мій концерт почався з подяки нашим військовим, яким ми завдячуємо щохвилини безпеці нашого життя.

Також ця важлива мить була б неможлива без волі і таланту моєї великої та злагодженої команди! Люблю кожного, ціную вашу підтримку і розуміння нашої спільної мети ❤️‍🔥

